import React from "react";
import styles from "./sidebar.module.css";
import Img from "../../assests/logo.png";
const Sidebar = () => {
  return (
    <div className={styles.mainDiv}>
      <div>
        <img src={Img} alt="" width="240px" />
      </div>
      
    </div>
  );
};

export default Sidebar;
